import React, {useContext, useEffect, useState} from "react";
import {Link} from "react-router-dom";


function GetPriziv(){
    const [priziv, setPriziv] = useState([]);

     useEffect(() => {
        fetch(`http://127.0.0.1:8000/prizivniki/`)
            .then(response => response.json())
            .then((result) => {
                setPriziv(result);
            })
    }, []);
}

function GetCart(){
    const [cart, setCart] = useState([]);

     useEffect(() => {
        fetch(`http://127.0.0.1:8000/cart/`)
            .then(response => response.json())
            .then((result) => {
                setCart(result);
            })
    }, []);
     return cart
}

function Cart(){
    const cartss = GetCart()

    const carts = GetPriziv()

    const del=(id)=> {
        console.log(id)
        fetch(`http://127.0.0.1:8000/cart/12`, {
            method: "delete",
        })
            .then(res => {
                if (res.ok) {
                    console.log("HTTP request successful");
                    window.location.reload();
                } else {
                    console.log("HTTP request unsuccessful");
                }
            })

    }

    return (
        <div>
            <a href={`../`}>Начало/</a>
            <a href={`/priziv/`}>Призывники/</a>
            <a href = {'/priziv/cart'}>Армия/</a>
            <br/>
            <h1>Список людей для отправки в армию</h1>
            {GetCart().map(cart =>
                <div key = {cart.pk} className="manga_block2">
                    <div className="image_wrapper">
                        <Link to={`/models/getbyid/${carts[cart.surname - carts[0].id].id}`}>
                            <img className="manga_image" src={`${carts[cart.surname - carts[0].id].image_path}`} />
                        </Link>
                    </div>
                    <Link className="manga_link" to={`/models/getbyid/${carts[cart.surname - carts[0].id].id}`}>
                        {carts[cart.surname - carts[0].id].name} {carts[cart.surname - carts[0].id].vozrast}  ₽
                    </Link>
                    <br/>
                    <br/>
                    <input id="buy_button" className="buy_button" type="submit" value="Удалить" onClick={()=>{del(cart.id)}}/>

                </div>)}
            {cart ?.map(carts =>
                <div key = {carts.id} className="manga_block2">
                    <div className="image_wrapper">
                    </div>
                    <div className={"name"}><a>Фамилия:</a> {carts.surname}</div>
                    <br/>
                    <br/>
                    <input id="buy_button" className="buy_button" type="submit" value="Удалить" onClick={()=>{del(cart.id)}}/>

                </div>)}
            <button>Купить</button>
        </div>
    );
}
export default Cart;
